sys_variable_value.value:
(function execute(inputs, outputs)
 {
  if(inputs.step_input_status_code== '200')
  {
var responseObj = JSON.parse(inputs.step_input_response_body);
    outputs.diff = responseObj.result.difficulty;
    outputs.category = responseObj.result.category;
    outputs.ques = responseObj.result.question;
    outputs.id = responseObj.result.sys_id;
  }
})(inputs,outputs);

